insert  into `estimate`(`es_id`,`dh_id`,`us_id`,`es_content`,`es_date`,`es_score`,`es_star`,`es_main_img`,`hot`,`rihan`,`specialty`,`noodles`,`meat`,`daily`,`star`) values (1,1,2,'最喜欢这个菜了，强推强推','2018-12-01',5,59,'http://192.168.43.224:3001/public/images/estimate/1.jpg',0,1,0,1,0,1,0),(2,1,1,'太好吃啦！就是生意太好了，人太多，排队排了好久，但是是真的好吃','2018-09-16',4.5,45,'http://192.168.43.224:3001/public/images/estimate/2.jpg',0,0,1,1,0,0,0),(3,2,1,'第N次来这里吃东西了，超好吃，强力推荐，一定要吃这家店的招牌','2019-01-16',4.9,24,'http://192.168.43.224:3001/public/images/estimate/3.jpg',1,0,NULL,0,1,1,0),(4,2,3,'每周必点的一顿，下课后直接飞奔而来。太好吃了','2019-03-26',4.6,56,'http://192.168.43.224:3001/public/images/estimate/4.jpg',0,1,1,1,0,0,0),(5,3,0,'最近爱上了这道菜，连续吃了三天也不腻，也是真好吃了','2019-03-06',4.5,21,'http://192.168.43.224:3001/public/images/estimate/5.jpg',0,NULL,0,0,0,1,0),(6,3,4,'这个菜挺好吃的，还不贵，老板热人还超好的','2019-01-06',4.7,47,'http://192.168.43.224:3001/public/images/estimate/6.jpg',1,0,NULL,0,1,0,0),(7,4,2,'这个味儿佷鲜，还不是很腻，超喜欢吃的','2018-12-01',4.8,53,'http://192.168.43.224:3001/public/images/estimate/7.jpg',0,0,0,0,0,0,0),(8,4,4,'我从未尝过如此美味的食物，真是好吃啊','2018-09-16',4,50,'http://192.168.43.224:3001/public/images/estimate/8.jpg',1,0,1,1,1,1,0),(9,5,1,'真是好吃的这个，特别是不知道吃啥的时，直接走进这家店准没错','2019-01-16',5,67,'http://192.168.43.224:3001/public/images/estimate/9.jpg',0,0,0,NULL,0,0,0),(10,5,6,'从大一开始就超喜欢这个店的东西，好吃便宜，非常感人','2019-03-26',4.9,39,'http://192.168.43.224:3001/public/images/estimate/10.jpg',1,NULL,1,0,1,1,0),(11,6,0,'上次把手机拉在这里了，老板很好心的给我保留着让我来拿，感恩，老板家的东西也超好吃','2019-03-06',4.6,56,'http://192.168.43.224:3001/public/images/estimate/11.jpg',0,0,0,0,0,0,0),(12,6,3,'浙理最好吃的电，没有之一，单方面承认，不接受反驳','2019-01-06',4.7,66,'http://192.168.43.224:3001/public/images/estimate/12.jpg',1,0,0,0,0,1,0),(13,7,4,'啊啊啊啊啊，最喜欢这个菜了，强推强推','2019-03-26',4.4,49,'http://192.168.43.224:3001/public/images/estimate/13.jpg',0,0,NULL,1,1,0,0),(14,7,5,'没什么好说的了，就是好吃！！！','2018-12-01',4.3,68,'http://192.168.43.224:3001/public/images/estimate/14.jpg',0,1,1,0,0,0,0),(15,8,5,'还蛮好吃的这个菜，偶尔跟室友一起来这家店吃，不会失望',