/*Table structure for table `gonglue` */

DROP TABLE IF EXISTS `gonglue`;

CREATE TABLE `gonglue` (
  `gl_id` int(11) NOT NULL AUTO_INCREMENT,
  `us_id` int(11) DEFAULT NULL,
  `gl_name` varchar(128) DEFAULT NULL,
  `gl_date` date DEFAULT NULL,
  `gl_main_img` mediumtext,
  `gl_content` mediumtext,
  `star` int(2) DEFAULT '0',
  `gl_star` int(11) DEFAULT '0',
  `info` varchar(1024) DEFAULT '在浙理，你可以拥有别人家的网红餐厅，以及成为最好的自己！',
  PRIMARY KEY (`gl_id`),
  KEY `gl_us1` (`us_id`),
  CONSTRAINT `gl_us1` FOREIGN KEY (`us_id`) REFERENCES `user` (`us_id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

/*Data for the table `gonglue` */

insert  into `gonglue`(`gl_id`,`us_id`,`gl_name`,`gl_date`,`gl_main_img`,`gl_content`,`star`,`gl_star`,`info`) values (1,1,'浙理食堂人气新菜C位出道！','2019-05-05','http://192.168.43.224:3001/public/images/estimate/14.jpg','  <p>浙理食堂在三月份上新的菜品，你吃过几种？吃的是<strong>花椒扣肉、砂锅豆腐、麻花鱼</strong>还是<strong>菜心小肉圆</strong>？</p> \r\n  <p><strong>猜你喜欢</strong></p> \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/14.jpg\" width=\"100%\" /></p> \r\n  <p><strong>松子玉米</strong></p> \r\n  <p>桂花园3楼</p> \r\n  <br>\r\n\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/1.jpg\" /></p> \r\n  <p><strong>鲜果炒鱼仁</strong></p> \r\n  <p>桂花园3楼</p> \r\n  <br>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/3.jpg\" width=\"100%\" /></p> \r\n  <p><strong>麻花鱼</strong></p>\r\n  <p>桂花园1楼</p>\r\n  <br>\r\n  \r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/11.jpg\" /></p> \r\n  <p><strong>乌鸡枸杞盅</strong></p>\r\n  <p>桂花园1楼</p>\r\n  \r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/4.jpg\" width=\"100%\" /></p> \r\n  <p><strong>凤梨肉</strong></p>\r\n  <p>玫瑰园1楼</p>\r\n  <br>\r\n  \r\n  \r\n  \r\n  <p><strong>用户评价</strong></p>\r\n  <p><strong>兔子&nbsp;❤❤❤❤❤</strong></p>\r\n  <p><strong>火龙果山药</strong>堪称绝佳！有点像蓝莓山药。我以前觉得山药和蓝莓配是最完美的，现在发现其实火龙果一点都不输给蓝莓！火龙果甜甜的，绵软细腻，山药是清脆爽口。吃的时候完全不会觉得甜腻。两者搭在一起真的是绝配。</p>\r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/2.jpg\" /></p>\r\n  \r\n  <p class=\"ql-align-right\">（买家秀：火龙果山药）</p>\r\n  \r\n  <p><strong>美食家&nbsp;❤❤❤❤</strong></p>\r\n  <p>除了花椒扣肉没有吃过，其他比如砂锅豆腐、麻花鱼、菠萝炒肉什么的<strong>都吃过</strong>，味道还不错。</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/12.jpg\" width=\"100%\" /></p>\r\n  <p><strong>一个广东人&nbsp;❤❤❤❤</strong></p>\r\n  <p>13的<strong>乌鸡枸杞盅</strong>做的挺不错的。</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/15.jpg\" width=\"100%\" /></p>\r\n  \r\n  \r\n  <p><strong>一位先生&nbsp;❤❤❤❤</strong></p>\r\n  <p>记不清是叫<strong>草莓炒花菜</strong>还是<strong>草莓炖花菜</strong>了。当时抱着好奇的心态点了这道菜，颜色粉红，少女心十足，倒是有些心动。入口酸且甜，但总体偏甜。花菜的清香夹杂着草莓的香甜，配合黏糯的米饭，一草莓一口饭，一颗花菜一口饭，莫名觉得有点好吃。我觉得菜的创意指数三星半，外观指数四星，味道指数三星半。</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/7.jpg\" width=\"100%\" /></p>\r\n  <p><strong>想吃肉&nbsp;❤❤</strong></p>\r\n  <p><strong>青椒炒洋葱</strong>吗？也有可能是青椒炒洋葱炒肉吧，但是没有吃到肉。</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/4.jpg\" /></p>\r\n  <p class=\"ql-align-right\"><br /></p>\r\n  <p><strong>很随便的学长&nbsp;&nbsp;❤❤</strong></p>\r\n  <p>随便点的<strong>香辣鸭脖</strong>，感觉鸭脖比较软，个人觉得还是包装的好吃。</p>\r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/17.jpg\" /></p>\r\n\r\n  \r\n  <p>这些新菜品的出现，正是源于学校膳食科三月份开展的<strong>创新菜与创新月活动</strong>。在桂花园一楼、三楼，玫瑰园一楼这三个保障性食堂当中，每个食堂<strong>每周都会出十个左右的新菜品</strong>，供大家品尝。</p>\r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/6.jpg\" width=\"100%\" /></p>\r\n  <p class=\"ql-align-right\">（扁豆炒百合）</p>\r\n  \r\n  <p>创新菜中散发着<strong>家乡的味道</strong>。譬如桂花园一楼的<strong>花椒扣肉</strong>，这道属于淮扬菜系的菜，被厨师们搬上了浙理的餐桌，带来了满满的乡情。膳食服务科的职员们也将<strong>“为家人烧菜”</strong>作为他们的工作理念，研究着各地不同风味的饭菜。</p>\r\n  \r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/20.jpg\" width=\"100%\" /></p>\r\n  <p class=\"ql-align-right\">（菠萝炒肉）</p>\r\n  \r\n  <p>除了带着家乡味道的创新菜之外，还有食堂自创的一些菜品，既<strong>新颖又富含营养价值</strong>。比如在桂花园和玫瑰园都有的<strong>麻花鱼</strong>。这道菜将酥脆的油炸鱼和香脆的麻花进行结合，两相搭配，具有<strong>爽脆的口感</strong>，嘎吱脆和嘎嘣脆齐响，倒是成了食堂内别样的风景。</p>\r\n  \r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/19.jpg\" /></p>\r\n  <p class=\"ql-align-right\">（菜心小肉圆）</p>\r\n  \r\n  <p>食堂的工作人员一直在探索，<strong>他们不断地进行菜品的创新，</strong>为了吸引着大家更多地走进食堂，想到要去尝试去感受，也使食堂的工作人员更加了解师生的饮食口味和趋向，以便对服务和饮食进行更好的完善。</p>\r\n  \r\n  <h5><br /></h5>',0,3,'浙理食堂在三月份上新的菜品，你吃过几种？吃的是花椒扣肉、砂锅豆腐、麻花鱼还是菜心小肉圆？'),(2,2,'学长带你吃浙理','2019-05-09','http://192.168.43.224:3001/public/images/estimate/22.jpg',' <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/11.jpg\" width=\"100%\" /></p>\r\n  <div style=\"text-align:center;\">\r\n    <p><strong>你想好吃什么了吗</strong></p>\r\n  <p>小小的食堂</p>\r\n  <p>满满的美味</p>\r\n  <p><br /></p>\r\n  <p>昨晚又熬夜了</p>\r\n  <p>与对象，死党聊天忘记了时间</p>\r\n  <p>打游戏，追剧到了深夜</p>\r\n  <p>第二天长叹一声</p>\r\n  <p>今晚一定要早睡</p>\r\n  <p>明早一定吃早餐</p>\r\n  <p>然后又在矛盾中度过了一天</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/21.jpg\" /></p>\r\n  <p>&nbsp;</p>\r\n  <p>一日之计在于晨</p>\r\n  <p>早餐，美好生活的开始</p>\r\n  <p>早餐的质量在一定程度上决定了这一天的好坏</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;</p>\r\n  <p>在浙理</p>\r\n  <p>你不得不错过的早餐</p>\r\n  <p><strong>包子油条豆腐脑</strong>，样样具备</p>\r\n  <p><strong>发糕煎饼杂粮粥</strong>，通通带走</p>\r\n  <p>&nbsp;</p>\r\n  <p>在理工玫瑰园一楼</p>\r\n  <p>有一道一道“人见人爱，花见花开”的一道菜</p>\r\n  <p><strong>葱油拌面</strong></p>\r\n  <p>十八里外飘香</p>\r\n  <p>起床的动力全是因为它</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/22.jpg\" /></p>\r\n  <p><strong style=\"color: rgb(142, 201, 101);\">葱油拌面</strong></p>\r\n  <p><strong>独家记忆</strong></p>\r\n  <p>&nbsp;</p>\r\n  <p>第五节课当你在教室听毛概老师高谈阔论的时候</p>\r\n  <p>你的脑袋是不是已经全是食堂阿姨的笑容</p>\r\n  <p>你的心里是不是已经在想盘中是那道菜了</p>\r\n  <p>理工哪里最红，当然是食堂啦</p>\r\n  <p>作为网红食堂</p>\r\n  <p>玫瑰园二楼又挑起了这条大梁</p>\r\n  <p><strong>瓦罐石锅大碗饭</strong></p>\r\n  <p><strong>花蛤烧烤辛拉面</strong></p>\r\n  <p>吃完delicious午餐，小憩一下</p>\r\n  <p>开始下午忙碌的学习</p>\r\n  <p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"http://192.168.43.224:3001/public/images/gonglue/23.jpg\" width=\"100%\" /></span></p>\r\n\r\n  <p><span style=\"color: rgb(142, 201, 101);\">瓦罐套餐</span></p>\r\n  <br><br>\r\n  <p><strong>营养界</strong></p>\r\n  <p><strong>大姐大</strong></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/24.jpg\" width=\"100%\" /></p>\r\n\r\n  <p>石锅拌饭</p>\r\n  <p><strong>韩料首选</strong></p> \r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/25.jpg\" width=\"100%\" /></p>\r\n  <p><strong>小火锅</strong></p>\r\n  <p><strong>解瘾首选</strong></p>\r\n  <p><br /></p>\r\n  <p>落日生余晖，尽在食堂里</p>\r\n  <p>浅浅的晚霞，美美的晚餐</p>\r\n  <p>阿姨，来碗<strong>五谷鱼粉</strong></p>\r\n  <p>帅哥，上份<strong>重庆小面</strong></p>\r\n  <p>三两口</p>\r\n  <p>尽是美味</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/26.jpg\" /></p>\r\n  <p><strong>重庆小面</strong></p>\r\n  <p><strong>火上浇油</strong></p><p><br /></p>\r\n  <p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"http://192.168.43.224:3001/public/images/gonglue/27.jpg\" width=\"100%\" /></span></p>\r\n  \r\n  <p><strong>五谷鱼粉</strong></p>\r\n  <p><strong>汤美味鲜</strong></p><p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/28.jpg\" width=\"100%\" /></p>\r\n  \r\n \r\n  <p><strong>营养套餐</strong></p>\r\n  <p><strong>简便实惠</strong></p>\r\n  <p><br /></p>\r\n  <p>昏黄的路灯，枫叶映的有点黄</p>\r\n  <p>一对对情侣悠闲地走在学林街</p>\r\n  <p>一群群死党懒散地说笑打闹</p>\r\n  <p>开启夜宵撸串撸饼模式</p>\r\n  <p>西北孜然<strong>羊肉</strong>格外美味</p>\r\n  <p>东海蒜蓉<strong>扇贝</strong>那叫个鲜</p>\r\n  <p><strong>葱油大饼缙云烧饼炸鸡排</strong></p>\r\n  <p>啊，我的胃</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/29.jpg\" width=\"100%\" /></p>\r\n  <p><strong>养生粥</strong></p>\r\n  <p><strong>养胃利器</strong></p>  <p><br /></p>\r\n  <p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"http://192.168.43.224:3001/public/images/gonglue/30.jpg\" width=\"100%\" /></span></p>\r\n  <p><strong>缙云烧饼</strong></p>\r\n  <p><strong>中华美食</strong></p><p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/31.jpg\" width=\"100%\" /></p>\r\n  <p><strong>烧烤</strong></p>\r\n  <p><strong>蠢蠢欲动</strong></p>\r\n  <p><br /></p>\r\n  <p>你是不是已经馋了</p>\r\n  <p>想吃遍理工食堂</p>\r\n  <p>No</p>\r\n  <p>一日三餐规律和平衡最重要</p>\r\n  <p>注意搭配好哦</p>\r\n  <p><br /></p><p><strong>END</strong></p>\r\n  </div>',0,0,'你想好吃什么了吗？小小的食堂，满满的美味'),(3,2,'我们一起吃紫薇阁！','2019-04-11','http://192.168.43.224:3001/public/images/estimate/11.jpg','<p><img src=\"http://mmbiz.qpic.cn/mmbiz_gif/p2omeerpqCsQsQf9Elhgw0K0jGNIYbqLTwicTWiaW31E8ab6XMmGz6lpGG8XW13nyic3tLicvmbRgDFXDzcN9k1SWg/0?wx_fmt=gif&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" /></p>\r\n  <p><br /></p>\r\n  <div style=\"text-align: center;\">\r\n    \r\n  <p class=\"ql-align-center\">俗话说</p>\r\n  <p class=\"ql-align-center\">“浙理有三好”</p>\r\n  <p class=\"ql-align-center\">食堂好！</p>\r\n  <p class=\"ql-align-center\">食堂好！！</p>\r\n  <p class=\"ql-align-center\">食堂好！！！</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://mmbiz.qpic.cn/mmbiz_gif/YPfby9yDIJ9e6yE8pOPeIvGMZAwoVszzhyYAiaib80d9VAkMOVs5s3QbQIkxyTjfMCAzNeW10xovfl1QYPowqYwg/0?wx_fmt=gif&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" /></p>\r\n  <p><br /></p>\r\n  <p>桂花园</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/1.jpg\" /></p>\r\n  <p>2017年｜夏</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;桂子月中落，</p>\r\n  <p>天香云外飘。</p>\r\n  <p><br /></p>\r\n  <p>出了小北门，</p>\r\n  <p>就是桂花园。</p>\r\n  <p>每天中午放学之际，</p>\r\n  <p>都会有阵阵飘香从桂花园中传来。</p>\r\n  <p>物美，价廉，性价比高，</p>\r\n  <p>种种优点吸引着同学们。</p>\r\n  <p><br /></p>\r\n  <p><strong>一楼</strong>每周都会推出特价菜品</p>\r\n  <p>月末时总会吸引大量同学</p>\r\n  <p>（穷酸脸）</p>\r\n  <p><br /></p>\r\n  <p><strong>二楼</strong>则有着丰富的菜品</p>\r\n  <p>热干菜、黄焖鸡、刀削面</p>\r\n  <p>各地的美食都能在这里找到</p>\r\n  <p><br /></p>\r\n  <p><strong>三楼</strong>是教职工食堂</p>\r\n  <p>菜品可口且便宜</p>\r\n  <p>装备了自动结算机后效率更高</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/2.jpg\" /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/3.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">推荐指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★☆</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">价格指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★☆☆</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">环境指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★☆☆</span></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>玫瑰园</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/4.jpg\" /></p>\r\n  <p>2017年｜夏</p>\r\n  <p>作为刷爆朋友圈的网红餐厅</p>\r\n  <p>玫瑰园是浙理食堂的颜值担当</p>\r\n  <p><br /></p>\r\n  <p>在充满工业气息的餐厅里</p>\r\n  <p>台球、音乐、美食</p>\r\n  <p>互不相干的元素融合在一起</p>\r\n  <p>迸发出惊为人天的激情</p>\r\n  <p><br /></p>\r\n  <p><strong>一楼的主调</strong>是朴素无华</p>\r\n  <p>小食和主餐的搭配能让你感受到</p>\r\n  <p>生活的快速和慵懒</p>\r\n  <p><br /></p>\r\n  <p><strong>二楼的主调</strong>是奢华高调</p>\r\n  <p>舌尖上美食的碰撞</p>\r\n  <p>加上休闲和娱乐</p>\r\n  <p>你总会在这里找到你的挚爱</p>\r\n  <p><br /></p>\r\n  <p><strong>三楼的主调</strong>是深藏不露</p>\r\n  <p>偶然发现的菜品会让你赞不绝口</p>\r\n  <p>深夜食堂总是带来最后的温暖</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/5.jpg\" /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/6.jpg\" /></p>\r\n  <p><span style=\"http://192.168.43.224:3001/public/images/gonglue/7.jpg\" /></span></p>\r\n  <p><br /></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">推荐指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★★</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">价格指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★☆</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">环境指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★★</span></p>\r\n  <p><br /></p>\r\n  <p>紫薇阁</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/8.jpg\" /></p>\r\n  <p>2017年｜夏</p>\r\n  <p>作为可以点外卖的食堂</p>\r\n  <p>它在下雨天拯救了很多人</p>\r\n  <p><br /></p>\r\n  <p>炒酸奶帅气的小哥哥</p>\r\n  <p>奶茶店好看的小姐姐</p>\r\n  <p>紫薇阁有很多美等着你发现</p>\r\n  <p><br /></p>\r\n  <p>昏暗的灯光舒服的沙发</p>\r\n  <p>自助点唱机旋转小火锅</p>\r\n  <p>在这里有狼人和预言家的厮杀</p>\r\n  <p>还有爪子和娃娃机的大战</p>\r\n  <p><br /></p>\r\n  <p><strong>一楼的特色</strong>有最好吃的早餐</p>\r\n  <p>有酸酸甜甜的炒酸奶</p>\r\n  <p>有每天食堂大叔阿姨的笑脸</p>\r\n  <p><br /></p>\r\n  <p><strong>二楼的特色</strong>有宽敞的桌椅</p>\r\n  <p>打包人的天堂</p>\r\n  <p>还有种类繁多的馄饨饺子</p>\r\n  <p><br /></p>\r\n  <p><strong>三楼的特色</strong>有迷人的环境</p>\r\n  <p>白天的美食城夜晚的party</p>\r\n  <p>在暗黄的灯光下肆意放纵</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/9.jpg\" /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/10.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">推荐指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★☆</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">价格指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★☆</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">环境指数</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">★★★☆</span></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://mmbiz.qpic.cn/mmbiz_gif/YPfby9yDIJ9e6yE8pOPeIvGMZAwoVszzhyYAiaib80d9VAkMOVs5s3QbQIkxyTjfMCAzNeW10xovfl1QYPowqYwg/0?wx_fmt=gif&amp;tp=webp&amp;wxfrom=5&amp;wx_lazy=1\" /></p>\r\n  <p><br /></p>\r\n  <p>在浙理的食堂</p>\r\n  <p>不管你喜欢哪一类</p>\r\n  <p>总会有你喜欢的菜</p>\r\n  <p class=\"ql-align-center\"><br /></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">春花秋月何时了？</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">浙理美食知多少。</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">问君能有几多愁？</span></p>\r\n  <p class=\"ql-align-center\"><span style=\"color: rgb(169, 167, 158);\">恰似一桌美食入口中。</span></p>\r\n  <h5><br /></h5>\r\n  </div>\r\n',0,0,'俗话说“浙理有三好”食堂好！食堂好1食堂好！'),(4,4,'浙理你想不到的美食','2019-03-20','http://192.168.43.224:3001/public/images/estimate/6.jpg','<p><img src=\"http://192.168.43.224:3001/public/images/gonglue/41.jpg\" /></p>\r\n    <div style=\"text-align:center;\">\r\n      <p>&nbsp;&nbsp;&nbsp;浙理食堂一直是理工学子的最爱，从平价的桂花园到好吃的网红食堂，满足同学们的各类需求～因此，理工大学是号&nbsp;称90斤进校，120斤毕业的大学。</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;今天小编要分享的则是这几个必吃的理工美食。</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><strong>「桂花园」</strong></p>\r\n  <p><strong>&nbsp;&nbsp;葱油拌面</strong></p>\r\n  <p>&nbsp;&nbsp;推荐指数</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/42.jpg\" width=\"100%\" /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;葱油拌面是一道美味可口的汉族名点，属于上海菜</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;一区面食窗口的葱油拌面价格便宜，分量又足。热腾腾的面条洒上葱花和调料，最后在浇上热水，一碗葱油拌面&nbsp;&nbsp;就出锅了。</p>\r\n  <p>&nbsp;&nbsp;&nbsp;葱油拌面都是现做现卖，刚做好的葱油拌面热气 腾腾的，再放点辣椒油完美！</p>\r\n  <p>&nbsp;&nbsp;&nbsp;&nbsp;同学们喜欢在闲来无事的时候来一碗刚刚做好&nbsp;的&nbsp;葱油拌面，就是感到大大的满足。</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/43.jpg\" /></p>\r\n  <p>&nbsp;&nbsp;价格：2RMB</p>\r\n  <p>&nbsp;&nbsp;地点：桂花园一楼面食部</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><strong>「玫瑰园」</strong></p>\r\n  <p>&nbsp;&nbsp;一个在曾经网上红极一时的餐厅</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;先PO一波上了新闻的玫瑰园二楼的工业风的装修</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/21.jpg\" /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/11.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;怎么样，是不是炫酷十足</p>\r\n  <p>&nbsp;&nbsp;玫瑰园不仅装修精美，美食也是种类繁多,有几款美食的点餐率极高</p>\r\n  <p>&nbsp;No.1&nbsp;麻辣香锅</p>\r\n  <p>&nbsp;&nbsp;推荐指数</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/31.jpg\" width=\"100%\" /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;&nbsp;麻辣香锅是二二食堂最受欢迎的一家，每到饭点，香锅档口前都会有很多人点餐。香锅的食材荤素分开，食材新鲜。厨师小哥颠勺技术熟练高超，在喇叭喊号声中，你的香锅准备好了。香锅香气浓郁，辣香扑鼻，你是不是迫不及待的想吃了呢？</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/31.jpg\" /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/44.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;人均：17RMB</p>\r\n  <p>&nbsp;&nbsp;地址：玫瑰园二楼</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;No.2 缙云烧饼</p>\r\n  <p>推荐指数</p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/gonglue/46.jpg\" width=\"100%\" /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;缙云烧饼是浙江缙云县有名的传统小吃。用梅干菜和夹心肉在炭炉内壁上烤出来的，具有锅里做出来的饼所没有的独特香味，也就成了缙云人闲时最爱的美味，缙云烧饼含有丰富的碳水化合物、蛋白质、脂肪，老少咸宜。</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;理工的缙云烧饼档口虽然开在边缘上，可这并不影响老板的生意。不管早饭、中饭或是晚饭，都有同学去买缙云烧饼。缙云烧饼口味很多，有白糖芝麻，梅干菜瘦肉等，另外，档口处还出售小馄饨、汤圆等，又增加了其吸引力。</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/1.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;价格：8RMB</p>\r\n  <p>&nbsp;&nbsp;地址：玫瑰园二楼</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;No.3&nbsp;美味炒饭</p>\r\n  <p>&nbsp;推荐指数</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/9.jpg\" width=\"100%\" /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;&nbsp;炒饭，是一种最简单的食物，却也是一种最美味的食物。在二二中间，有一家炒饭档口很受同学们喜爱。档口前有一个个有序排列的盒子，盒子里装的都是各种配料，你想吃哪个你就让炒饭小哥哥给你加哪个。鸡蛋、配料和米饭在铁板上翻滚，很快地，你的蛋炒饭已就位</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/8.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;价格：10RMB</p>\r\n  <p>&nbsp;地址：玫瑰园二楼</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><strong>「紫薇阁」</strong></p>\r\n  <p>&nbsp;紫薇阁最受欢迎的便是33餐厅</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;&nbsp;三三餐厅，是集火锅、唱K、酒吧等于一体的休闲餐厅。三三的晚上，依旧很热闹，大家去吃夜宵，喝奶茶，一起狼人杀，可谓是炒鸡开森了。</p>\r\n  <p>&nbsp;&nbsp;&nbsp;三三美食有韩式。中式、西式等，可随意选择。其中最受欢迎的无非是以下几种</p>\r\n  <p><br /></p>\r\n  <p>&nbsp;No.1&nbsp;旋转小火锅</p>\r\n  <p>&nbsp;推荐指数</p>\r\n  <p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"http://192.168.43.224:3001/public/images/estimate/7.jpg\" width=\"100%\" /></span></p>\r\n  <p>&nbsp;&nbsp;&nbsp;&nbsp;从夏天到冬天，旋转小火锅的人数只增不减。选择自己想吃的底料，端上阿姨给调制好的锅，你就可以坐在座位上，选择你喜欢的食物下锅。食材在旋转，而你眼花缭乱，不知从何“吃”起。</p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/6.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/10.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;价格：17-25RMB</p>\r\n  <p>&nbsp;&nbsp;地址：紫薇阁三楼</p>\r\n  <p><br /></p>\r\n  <p>No.2&nbsp;石锅拌饭</p>\r\n  <p>&nbsp;&nbsp;推荐指数</p>\r\n  <p><span style=\"background-color: rgb(238, 237, 235);\"><img src=\"http://192.168.43.224:3001/public/images/estimate/12.jpg\" width=\"100%\" /></span></p>\r\n  <p>&nbsp;&nbsp;&nbsp;“石锅拌饭”又称“韩国拌饭”。“石碗拌饭”，是韩国以及中国东北地区黑龙江、吉林、辽宁特有的米饭料理。在石锅锅内放入米饭及菜肴，再烤到锅底有一层锅巴，喷香诱人，石锅是陶做成的，厚重的黑色陶锅可直接拿到炉具烹煮，而且保温效果好。</p>\r\n  <p>&nbsp;&nbsp;&nbsp;&nbsp;33的石锅拌饭有肥牛、鸡肉、猪肉和鱿鱼四种底料，根据自己喜好可以加入金针菇、芝士等有另外，有板烧、黑椒等口味供你选择。</p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p><img src=\"http://192.168.43.224:3001/public/images/estimate/15.jpg\" /></p>\r\n  <p><br /></p>\r\n  <p><br /></p>\r\n  <p>&nbsp;&nbsp;价格：13-15RMB</p>\r\n  <p>&nbsp;&nbsp;地址：紫薇阁三楼</p>\r\n  <p><br /></p>\r\n  <h5>&nbsp;&nbsp;&nbsp;&nbsp;到这里，理工的美食攻略已经介绍完毕了，想&nbsp;必理工学子在学校的生活过得是十分滋润了。</h5>\r\n \r\n    </div>\r\n',0,1,' 浙理食堂一直是理工学子的最爱，从平价的桂花园到好吃的网红食堂，满足同学们的各类需求～因此，理工大学是号 称90斤进校，120斤毕业的大学'),(5,3,'聚餐哪里吃？浙理吃！','2019-05-05','http://192.168.43.224:3001/public/images/estimate/12.jpg','<h2>浙理食堂人气新菜C位出道！</h2><p>再简单的食物都有自己的灵魂</p><p>人生有很多味道无法复制</p><p class=\"ql-align-right\">——《深夜食堂》</p><p><br></p><p><br></p><p><br></p><p><img src=\"http://192.168.43.224:3001/public/images/estimate/14.jpg\"></p><p><br></p><p>浙理食堂在三月份上新的菜品，你吃过几种？吃的是<strong>花椒扣肉、砂锅豆腐、麻花鱼</strong>还是<strong>菜心小肉圆</strong>？</p><p><br></p><p><br></p><p><br></p><p><strong>猜你喜欢</strong></p><p><img src=\"http://192.168.43.224:3001/public/images/estimate/6.jpg\"></p><p><strong>松子玉米</strong></p><p>桂花园3楼</p><p><br></p><h5>“我们的<strong>菜谱就多达二十多本</strong>，开学前进行<strong>集中的学习</strong>，<strong>提高厨师的服务质量</strong>，也是为了<strong>给师生们提供最好的菜品和服务</strong>。”王科长如是说。每天中午或者傍晚，迅速被抢完的菜，或许就是对他们的努力创新最好的证明了吧！</h5><h5><br></h5>',0,1,'浙理食堂人气新菜C位出道！'),(12,0,'攻略测试','2019-05-14','data:image/png;base64,','<h5>攻略测试</h5><p><img src=\"data:image/png;base64,\"></p>',0,1,'在浙理，你可以拥有别人家的网红餐厅，以及成为最好的自己！');

