insert  into `user`(`us_id`,`us_ph`,`us_name`,`us_pwd`,`us_pic`,`us_sign`,`us_birh`,`us_email`,`us_bg`) values (0,'18177310581','小天使2号','123789','data:image/jpeg;base64,','我就是我不一样的烟火！！！！','1999-03-15','153769500@qq.com','data:image/jpeg;base64,'),(1,'15858197901','小吃货一枚','123456','data:image/jpeg;base64,','小小吃货一枚，安静的品味。','2000-04-19','153769501@qq.com','data:image/jpeg;base64,'),(2,'15858197906','尼古拉斯·美食','123456','http://192.168.43.224:3001/public/images/user_imgs/3.jpg','尼古拉斯·美食就是我，是的！','2000-10-01','153769502@qq.com','http://192.168.43.224:3001/public/images/user_bg/3.jpg'),(3,'15858197911','宇宙美少女战士','123456','http://192.168.43.224:3001/public/images/user_imgs/4.jpg','天青色等烟雨，而我在等你。','1999-03-15','153769503@qq.com','http://192.168.43.224:3001/public/images/user_bg/4.jpg'),(4,'15858197916','浙理一棵草','123456','http://192.168.43.224:3001/public/images/user_imgs/5.jpg','知否，知否，应是绿肥红瘦。','2000-04-19','153769504@qq.com','http://192.168.43.224:3001/public/images/user_bg/5.jpg'),(5,'15858197921','夜空中最亮的星','123456','http://192.168.43.224:3001/public/images/user_imgs/6.jpg','十年生死两茫茫，不思量，自难忘。','2000-10-01','153769505@qq.com','http://192.168.43.224:3001/public/images/user_bg/6.jpg'),(6,'15858197926','Sunday','123456','http://192.168.43.224:3001/public/images/user_imgs/7.jpg','月明星稀，乌鹊南飞。','1999-03-15','153769506@qq.com','http://192.168.43.224:3001/public/images/user_bg/7.jpg'),(7,'15858197902','牛皮糖大王','123456','http://192.168.43.224:3001/public/images/user_imgs/6.jpg','这家伙很懒，什么也没写',NULL,NULL,'http://192.168.43.224:3001/public/images/user_bg/6.jpg'),(15,'18177310588','爱校评用户','123456','http://192.168.43.224:3001/public/images/user_imgs/1.jpg','这家伙很懒，什么也没写',NULL,NULL,'http://192.168.43.224:3001/public/images/images/shuosi2.jpg'),(16,'18177310586','爱校评用户','123456','http://192.168.43.224:3001/public/images/user_imgs/1.jpg','这家伙很懒，什么也没写',NULL,NULL,'http://192.168.43.224:3001/public/images/images/shuosi2.jpg'),(17,'18177310582','爱校评用户','123456','http://192.168.43.224:3001/public/images/u